    function enhanceData(data) {
        _.each(data, function (dataValue) {
            dataValue.salesTotal = _.reduce(_.values(dataValue.sales), function (memo, num) {
                return memo + num;
            }, 0);
        });
    }

    function colorGenerator(data, color1, color2) {
        function calculateMinMaxRange(data) {
            var minMax = {min:Number.MAX_VALUE, max:Number.MIN_VALUE};
            _.chain(data).pluck('salesTotal').each(function (salesData) {
                if (salesData < minMax.min)
                    minMax.min = salesData;
                if (salesData > minMax.max)
                    minMax.max = salesData;
            });
            minMax.range = minMax.max - minMax.min;
            return minMax;
        }

        function seperateRGB(color) {
            var hexCode = parseInt(color.replace("#", "0x"));
            return {
                r:(hexCode >> 16) & 0xff,
                g:(hexCode >> 8) & 0xff,
                b:hexCode & 0xff
            }
        }

        var minMaxRange = calculateMinMaxRange(randomData);
        var color1RGB = seperateRGB(color1);
        var color2RGB = seperateRGB(color2);
        return function (value) {
            var valueScale = (value - minMaxRange.min) / minMaxRange.range;
            var r = color1RGB.r + (color2RGB.r - color1RGB.r) * valueScale;
            var g = color1RGB.g + (color2RGB.g - color1RGB.g) * valueScale;
            var b = color1RGB.b + (color2RGB.b - color1RGB.b) * valueScale;
            return "rgb(" + Math.ceil(r) + "," + Math.ceil(g) + "," + Math.ceil(b) + ")";
        }
    }

